import React from 'react'


const CompanyName = ({
    onChange,
    value
}) =>
    <div className="field">
        <label htmlFor="name">
            Unique Company Name:
        </label>
        <input
            id="name"
            type="text"
            onChange={onChange}
            maxlength="25"
            value={value}
            placeholder="Apple Ltd"
            required />
    </div>



