    function DevContracts() {
        let data = '';
        const requestOpt = {
            method: 'GET',
            headers: { 'Content-Type': 'application/json' },
        }
        async function fetchFunc() {
            return await fetch('http://127.0.0.1:5000/getContracts', requestOpt)
                .then(response => response.json())
                .catch(error => console.log(error));
        }
        (async () => {
            data = await fetchFunc();
        })()

        const DisplayData=[data].map(
            ()=>{
                return(
                    <tr>
                        <td>{data.id}</td>
                        <td>{[data].company_id}</td>
                        {/* <td>{info.contract_length}</td>
                        <td>{info.contract_value}</td>
                        <td>{info.description}</td>
                        <td>{info.progamming_language}</td>
                        <td>{info.location}</td>
                        <td>{info.open}</td>
                        <td>{info.date}</td> */}
                    </tr>
                )
            }
        )
        return (
            <div>
            <table class="table table-striped">
                <thead>
                    <tr>
                    <th>ID</th>
                    <th>ComID</th>
                    <th>ConName</th>
                    <th>ConLen</th>
                    <th>ConVal</th>
                    <th>ConDes</th>
                    <th>ProLan</th>
                    <th>Loc</th>
                    <th>Open</th>
                    <th>Date</th>
                    </tr>
                </thead>
                <tbody> 
                    {DisplayData}
                </tbody>
            </table>
        </div>
        )
    }



export default DevContracts;
